import React from 'react';

import './Partners.css';

function Partners() {

    return (
        <div className='partners-wrapper'>
            <h1>Partners</h1>
            <div className='row1'>
                <div className='row-partner'>
                    <a href="https://pontem.network/"><img src='https://pbs.twimg.com/profile_images/1352588008810274816/UbmhJ7qJ_400x400.jpg'/></a>
                </div>
            </div>

            <div className='bottom-line'/>

            <div className='row2'>

            </div>
        </div>
    )
}

export default Partners;
